import React from 'react';
import { Button, Modal, Form } from 'react-bootstrap';
import appendData from '../util/spreadsheet';
import '../enquiry/quick-enquiry.styles.css';

class QuickEnquiry extends React.Component{
    constructor(){
        super()
    }    

    handleSubmit(e){
        e.preventDefault();
    }

    render(){
        return(
        <>
            <Modal.Dialog>
                <Modal.Header>
                    <Modal.Title>Fill the details below</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                   <Form onSubmit = {this.handleSubmit}>
                       <Form.Group>
                            <Form.Label>Name</Form.Label>
                            <Form.Control type = "text" placeholder = "First Name"/>
                       </Form.Group>
                       <Form.Group>
                            <Form.Label>Email</Form.Label>
                            <Form.Control type = "email" placeholder = "Email ID"/>
                       </Form.Group>
                       <Form.Group>
                            <Form.Label>Mobile Number</Form.Label>
                            <Form.Control type = "number" placeholder = "Mobile Number"/>
                       </Form.Group>
                       <Form.Group>
                            <Form.Label>Course</Form.Label>
                            <Form.Control type = "text" placeholder = "Course"/>
                       </Form.Group>
                       <Button type="submit">Submit</Button>
                   </Form> 
                </Modal.Body>
            </Modal.Dialog>
        </>
        )
    }
}
export default QuickEnquiry;
